chdowns in Sunday's 27-20 win over New England. He added 36 yards and a touchdown on six rushing attempts.\",\"analysis\":\"Watson threw a three-yard touchdown pass to Randall Cobb in the first quarter, then barreled over a pair of Patriots defenders for a four-yard touchdown run to give his team a 14-10 lead in the second. He had a would-be highlight reel touchdown to Brandin Cooks wiped out by an ineligible man downfield but connected with Keke Coutee for a six-yard touchdown four plays later to take a 21-10 lead into the locker room. Watson failed to find the end zone in the second half but continued to rack up yardage, topping 300 yards for the fifth time in his last seven games. The star quarterback will look to keep rolling against the Lions on Thanksgiving.\",\"title\":\"Bounces back in win over Pats\"},{\"timeEpochMilli\":\"1606081046000\",\"contents\":\"Houston Texans quarterback Deshaun Watson completed 28 of 37 passes for 344 yards, two passing touchdowns, and a rushing score in a 27-20 victory over New England. Watson had virtually no running game all day- he led the team in rushing yards- and was forced to make something happen. Make something happen, he did, as he answered both the Patriots' first couple of scoring drives with touchdown drives of his own to give Houston a 14-10 lead. It's Watson's fifth 300-yard game this season and his ...\",\"url\":\"https://www.rotoballer.com/player-news/deshaun-watson-bounces-back-in-win-over-patriots/806790\",\"title\":\"Deshaun Watson Bounces Back In Win Over Patriots\"}],\"nameFirst\":\"Deshaun\",\"nameLast\":\"Watson\",\"hasLockedPremiumContent\":true,\"proTeam\":{\"abbreviation\":\"HOU\",\"location\":\"Houston\",\"name\":\"Texans\"},\"positionEligibility\":[\"QB\"]},\"requestedGames\":[{\"game\":{\"id\":6300,\"away\":{\"abbreviation\":\"NE\",\"location\":\"New England\",\"name\":\"Patriots\"},\"home\":{\"abbreviation\":\"HOU\",\"location\":\"Houston\",\"name\":\"Texans\"},\"startTimeEpochMilli\":\"160606800000